import React from 'react'
import './Home.css';
import { Parallax } from 'react-scroll-parallax';

class Work extends React.Component{ 
    render(){
        return(
            <div class="work">
                <p class="about"> Work Goes here once completed using cards</p>
            </div>
        )
    }
}export default Work
